script: |
  super -f tsv -I q9895.sql | sort > q9895.out

vector: true

inputs:
  - name: q9895.sql
    data: |
      SELECT * FROM tab0 WHERE - col2 * col0 + col2 * + + 87 NOT BETWEEN col2 * ( - col0 ) + - col2 + - ( col2 ) * - - col2 AND col0 * 15;
  - name: tab0

outputs:
  - name: q9895.out
    data: |
      15	81	47
